script: |
  super -f text -I q1949.spq | sort > q1949.out

inputs:
  - name: q1949.spq
    data: |
      SELECT DISTINCT - col0 + + 19 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT ( - 95 * + 84 - 9 ) >= - 11 * - col2 / col1;
  - name: tab0

outputs:
  - name: q1949.out
    data: |
      -68
      -78
      4
